  [],\n\t\"revision_timestamp\": \"2015-08-27T08:10:29.142824\",\n\t\"name\": \"final-environmental-assessment-and-finding-of-no-significant-impact-for-fire-management-on\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"For some six decades now the St. Marks
  National Wildlife Refuge has been managing and restoring the refuge for wildlife
  benefits. This has involved prescribed burning, mostly cool season, for understory
  enhancement, maintenance of historical forest type dominance, and hazard reduction.
  Wildfire suppression has also played an integral part in refuge management. This
  fire management system has served the refuge and wildlife objectives  well for almost
  a half century. However in recognition of a maturing Refuge forest, greater public
  environmental awareness and concern for natural resource management, changing National
  priorities, and advances in state of the art wildlife management, the U. S. Fish
  and Wildlife Service and St. Marks National Wildlife Refuge proposes through a revised
  fire management planprogram to finetune prescribed fire and wildfire suppression
  activities.  Proposed management actions will consist of both cool and warm season
  prescribed burning for understory enhancement, hazard reduction, maintenance of
  historical habitat type dominance, and natural pine regeneration and wildfire suppression.
  These proposed actions are in response to service objectives which seek to preserve,
  protect, and enhance habitat for wildlife populations which include threatened and
  endangered plants and animals, migratory birds, common indigenous wildlife species,
  and public recreation and environmental education.\",\n\t\"license_title\": \"License
